import React from 'react'
import styled, { ThemeProvider } from 'styled-components'
import {lightTheme} from './Themes';
import { Design, Develope} from './AllSvgs';


import LogoComponent from '../subComponents/LogoComponent';
import SocialIcons from '../subComponents/SocialIcons';
import PowerButton from '../subComponents/PowerButton';
import ParticleComponent from '../subComponents/ParticleComponent';
import BigTitle from '../subComponents/BigTitlte'

const Box = styled.div`
background-color: ${props => props.theme.body};
width: 100vw;
height:110vh;
position: relative;
display: flex;
justify-content: space-evenly;
align-items: center;


`

const Main = styled.div`
border: 2px solid ${props => props.theme.text};
color: ${props => props.theme.text};
background-color: ${props => props.theme.body};
padding: 2rem;
width: 30vw;
height: 65vh;
z-index:3;
line-height: 1;
cursor: pointer;

font-family: 'Ubuntu Mono',monospace;
display: flex;
flex-direction: column;
justify-content: space-between;

&:hover{
    color: ${props => props.theme.body};
    background-color: ${props => props.theme.text};
}
`

const Title = styled.h2`
display: flex;
justify-content: center;
align-items: center;
font-size: calc(1em + 1vw);

${Main}:hover &{
    &>*{
        fill:${props => props.theme.body};
    }
}

&>*:first-child{
margin-right: 1rem;
}
`

const Description = styled.div`
color: ${props => props.theme.text};
font-size: calc(0.6em + 1vw);
padding: 0.3rem 0;


${Main}:hover &{
   
        color:${props => props.theme.body};
    
}

strong{
    margin-bottom: 1rem;
    text-transform: uppercase;
}
ul,p{
    margin-left: 2rem;
}
`

const MySkillsPage = () => {
    return (
        <ThemeProvider theme={lightTheme}>
<Box>

<LogoComponent theme='light'/>
<SocialIcons theme='light'/>
<PowerButton />
<ParticleComponent theme='light' />
            <Main>
<Title>
    <Design width={40} height={40} /> Designer
</Title>
<Description>
I love to create design which are minimal and simple yet Engaging and attention pulling!
</Description>
<Description>
<strong>Softwares I Use:</strong>
<ul>
    <li>
        Adobe Photoshop, Illustrator, Figma
    </li>
    <li>
        Adobe After Effects,Premier Pro
    </li>
    <li>
        Blender
    </li>
</ul>
</Description>
<Description>
<strong>Design PortFolio:</strong>
<ul>
    <a href="https://drive.google.com/drive/folders/1ZiddZC0UW9Z9fHjfm9D_H0vfhfhOqb-e?usp=sharing" target="_blank" >
       Link
    </a>
    
</ul>
</Description>

            </Main>
            <Main>
<Title>
    <Develope width={40} height={40} /> Developer/Engineer
</Title>
<Description>
I have Basic Programming Knowledge & I keep learning with every Project I do.
</Description>
<Description>
<strong>Skills:</strong>
C, Python, Html, Css, Js, React, Bootstrap and learning
</Description>
<Description>
<strong>Internships:</strong>
Pyrotech Electronics(Practice School):Designed and Developed data Visualization components for SCADA systems, using React js, Syncfusion, CSS, and JavaScript.
Components included: Real-time line, Bar Graphs, Pie charts and Temprature displaying Flipcards.

</Description>

            </Main>

            <BigTitle text="SKILLS & Experience" top="80%" right="30%" />

        </Box>

        </ThemeProvider>
        
    )
}

export default MySkillsPage
